import {BrowserRouter, Routes, Route} from 'react-router-dom';
import HomePage from "./home";


export default function LoginPage() {
    return (
      <div>
      <div>
        <h1> Coin Calendar </h1>
        
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<HomePage />} />
          </Routes>
        </BrowserRouter>
      </div>
      </div>
    );
  }
